function repAddr(addrCode) {
	return addrCode.replace("500000","重庆市").replace("510000","四川省").replace("520000","贵州省").
	replace("530000","云南省").replace("540000","西藏自治区").replace("610000","陕西省").
	replace("620000","甘肃省").replace("630000","青海省").replace("640000","宁夏回族自治区").
	replace("650000","新疆维吾尔自治区").replace("710000","台湾省").replace("810000","香港特别行政区").
	replace("110000","北京市").replace("120000","天津市").replace("130000","河北省").
	replace("140000","山西省").replace("150000","内蒙古自治区").replace("210000","辽宁省").
	replace("220000","吉林省").replace("230000","黑龙江省").replace("310000","上海市").
	replace("320000","江苏省").replace("330000","浙江省").replace("340000","安徽省").
	replace("350000","福建省").replace("360000","江西省").replace("370000","山东省").
	replace("410000","河南省").replace("420000","湖北省").replace("430000","湖南省").
	replace("440000","广东省").replace("450000","广西壮族自治区").replace("460000","海南省");
}

