/*省市联动*/
function s_seach(){
	$.ajax({
		 type: "POST",
		 url: PATH+"/region",
		 //data: {sCode:xCode,pageNumber:pageNumber},
		 dataType: "json",
		 success: function(data){
			if(data==null||data==undefined||data.length<1){
				alert("查询出错");
			}else{
				//console.log(data);
				for(var i=0; i<data.length;i++){
					if(data[i].PAR_ID == "86"){
						$("#province").append("<option value='"+data[i].REGION_ID+"'>"+data[i].REGION_NAME+"</option>");
					}
				}
				$("#province").change(function(){
					var num = $(this).val();
					$("#city").html("");
					$("#city,#expectShop").html('<option value="0">请选择</option>');
					for(var k=0; k<data.length;k++){
						if(data[k].PAR_ID == num){
							$("#city").append("<option value='"+data[k].REGION_ID+"'>"+data[k].REGION_NAME+"</option>");
						}
					}
				});
				$("#city").change(function(){
					region_id = $(this).val();
					//jx_seach();
					jx_seachNum();
				})
			}
		}
	});
}


//商机
function zsubmit(){
	//姓名
	var custName = $("#custName").val();
	//性别
	var custSex = $("#custSex").val();
	//电话
	var mobile = $("#mobile").val();
	//地区
	var province = $("#province").val();
	var city = $("#city").val();
	//注册ID
	var registId = $("#registId").val();
	//订单属性
	var orderType = $("#orderType").val();		
	//预算
	var budget = $("#budget").val();
	//需求有效期
	var validity = $("#validity").val();
	//意向车型A
	var buyModelA = $("#buyModelA").val();
	var buyOtherA = $("#buyOtherA").val();
	//alert(buyModelA)
	//意向车型B
	var buyModelB = $("#buyModelB").val();
	var buyOtherB = $("#buyOtherB").val();
	//意向车型C
	var buyModelC = $("#buyModelC").val();
	var buyOtherC = $("#buyOtherC").val();
	//现有车车型
	var saleModel = $("#saleModel").val();
	var saleOther = $("#saleOther").val();
	//初登日期
	var regDate = $("#regDate").val();
	//里程
	var mileage = $("#mileage").val();
	//期望4S店
	var expectShop = $("#expectShop").val();
	//用户备注
	var usreNote = $("#usreNote").val();
	//来源网站
	var sourceSite = $("#sourceSite").val();

	//校验
	var custName = $("#custName").val().replace(/ /g,"");	
	if(custName==""){
		alert("姓名不能为空！")
		return;
	}	
	var custSex = $("input[name='custSex']:checked").val();	
	
	var mobile = $("#mobile").val().replace(/ /g,"");	
	if(mobile==""){
		alert("电话不能为空！")
		return;
	}

	if (!(/^1[0-9][0-9]\d{4,8}$/.test(mobile))) {
		alert("请输入正确的手机号");
		return;
	}

	var province = $("#province").val().replace(/ /g,"");	
	if(province=="0"){
		alert("请选择所在省份！")
		return;
	}

	var city = $("#city").val().replace(/ /g,"");	
	if(city=="0"){
		alert("请选择所在城市！")
		return;
	}
	
	var orderType = $("#orderType").val().replace(/ /g,"");	
	
	var budget = $("#budget").val().replace(/ /g,"");	
	
	var validity = $("#validity").val().replace(/ /g,"");	

	
	
	
	if(orderType!="28470002"){
		buyModelA = $("#buyModelA").val().replace(/ /g,"");	
		if(buyModelA=="0"){
			alert("请选择意向车系！")
			return;
		}
	}

	if(orderType!="28470001"){
		//品牌
		var brand = $("#brand").val();
		if(brand=="0"){
			alert("请选择品牌！")
			return;
		}

		//厂商
		var factory = $("#factory").val();
		if(factory=="0"){
			alert("请选择厂商！")
			return;
		}
		//现有车系
		if(saleModel=="0"){
			alert("请选择现有车系！")
			return;
		}
	}
	

	var expectShop = $("#expectShop").val().replace(/ /g,"");	
	if(expectShop=="0"){
		alert("请选择经销商！")
		return;
	}
	
	
	var sourceSite = $("#sourceSite").val().replace(/ /g,"");	
	if(sourceSite==""){
		alert("来源网站不能为空！")
		return;
	}
	
	//console.log(custName+","+custSex+","+mobile+","+province+","+city+","+registId+","+orderType+","+budget+","+validity+","+buyModelA+","+buyOtherA+","+mileage+","+expectShop+","+usreNote+","+sourceSite);
	$.ajax({
		 type: "POST",
		 url: PATH+"/car/save",
		 data: {"custName":custName,"custSex":custSex,"mobile":mobile,"province":province,"city":city,"registId":registId,"orderType":orderType,"budget":budget,"validity":validity,"buyModelA":buyModelA,"buyOtherA":buyOtherA,"buyModelB":buyModelB,"buyOtherB":buyOtherB,"buyModelC":buyModelC,"buyOtherC":buyOtherC,"saleModel":saleModel,"saleOther":saleOther, "regDate":regDate,"mileage":mileage,"expectShop":expectShop,"usreNote":usreNote,"sourceSite":sourceSite},
		 //data: {"mobile":mobile,"province":province,"city":city,"expectShop":expectShop,"sourceSite":sourceSite},
		 dataType: "json",
		 success: function(data){
		 	if(data==null||data==undefined||data.length<1){
				alert("查询出错");
			}else{
				//console.log(data);
				if(data.backhaulId){
					//alert(data.description);
					alert("保存成功");
					location.href = "../zdh/back_index.jsp";
				}
			}
		},
		error: function(e) {
			alert(e.message);
		}
		
	});
}

//选择品牌
function brand(){
	$.ajax({
           	url:  PATH+"/car/wBrandHb",
			dataType: "json",
            type: 'post',
            success: function (json) {
                $("#brand").empty();
                $("#brand").append("<option value='0'>选择品牌</option>");
                for (var i = 0; i < json.length; i++) {
                    $("#brand").append("<option value='" + json[i].bids+ "'>" + json[i].bname + "</option>");
                }
            }
        });	
}

function initSeries() {
	$("#saleModel").empty();
	$("#saleModel").append("<option value=\"0\">选择车系</option>");
}

$(function(){
	//车型检索
	//seach();
	//品牌
	 brand(); 
	//商机
	s_seach();
	//经销商检索	
	//jx_seach();

	$("#brand").change(function () {
		initSeries();
		var bids =  $(this).val();
		$.ajax({
           	url:  PATH+"/car/wMake",
			dataType: "json",
            type: 'post',
            data: {
                bids: bids
            },
            success: function (json) {
                $("#factory").empty();
                $("#factory").append("<option value='0'>选择厂商</option>");
                for (var i = 0; i < json.length; i++) {
                	console.log(json[i]);
                    $("#factory").append("<option value='"+json[i].factoryid+"'>" + json[i].factory + "</option>");
                }
            }
        });
    });

    $("#factory").change(function () {
    	var fid = $("#factory").val();
    	$.ajax({
            url:  PATH+"/car/wSeries",
            dataType: "json",
            type: 'post',
            data: {
            	fid: fid
            },
            success: function (json) {
                $("#saleModel").empty();
                $("#saleModel").append("<option value='0'>选择车系</option>");
                for (var i = 0; i < json.length; i++) {
                    $("#saleModel").append("<option value='" + json[i].seriesId + "'>" + json[i].seriesName + "</option>");
                }
            }
        });

    });

	
})

